import React from "react";
import "./styles.scss";
const SignIn = ({ data, onClick }) => {
 
  return (
    <div className="signin">
      <div className="signin_container">
        <h2 className="signin_title">Create an account</h2>
        <p className="signin_subtitle">sub title goes here</p>
 
      </div>
    </div>
  );
};
 
 
export default SignIn;
